import React from "react";
import logo from './logo.svg';
import './App.css';
import 'style_main'

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
      fetch("/").then((res) => res.json()).then((data) => setData(data.message));
    }
  );



  return (
    <div className="App">
      <div class="ring">
          <i style="--clr:#fa65ff;"></i>
          <i style="--clr:#8c63ff;"></i>
          <i style="--clr:#36effc;"></i>
          <div class="login">
            <h2>Login</h2>
            <div class="inputBx">
              <input type="text" placeholder="Username" />
            </div>
            <div class="inputBx">
              <input type="password" placeholder="Password" />
            </div>
            <div class="inputBx">
              <input type="submit" value="Sign in" />
            </div>
            <div class="links">
              <a href="#">Forget Password</a>
              <a href="#">Signup</a>
            </div>
          </div>
      </div>
    </div>
  );
}

export default App;
